    e.preventDefault()
    console.log('tt');
  }

  return (
    <>
      <h3>구구단연습</h3>
      <form onSubmit={fnSubmit}>
        <input defaultValue={num1} type="number" min="0" max="9" readOnly />
        *
        <input defaultValue={num2} type="number" min="0" max="9" readOnly />
        =
        <input type="number" min="0" max="99" />
        <button style={{display:"none"}}>결과</button>
      </form>
      <p className="output">결과 : ?, 점수 : 0점</p>
    </>
  );
}


export default App;
